import React from 'react'

class Contacts extends React.Component{

    render(){
        return(
            <div className="display">
                {
                    this.props.contacts.map(c => {
                        return(
                            <Contact contact={c}/>
                        )
                    })
                }
            </div>
        );
    }
}

export default Contact;
